import React, {useState} from 'react';
import ToDo from './Todo';

function TodoList(props) {
    const [todoList, setTodoList] = useState(['zadanie 1', 'zadanie 2', 'zadanie 3']);

    return (
        <div>
        todo list 3
        {todoList.map((todo) => {
            <ToDo
                todo = {todo}    
             />
        })}</div>
    )
}

export default TodoList;
